#!/bin/sh
export IN3_ZKS=http://localhost:3030
export IN3_CHAIN=http://localhost:8545
export IN3_PK=0xe20eb92b34a3c5bd2ef0802a4bc443a90e73fc4a0edc4781446d7b22a44cc5d8
export ZK_ACCOUNT=0x8a91dc2d28b689474298d91899f0c1baf62cb85b
export IN3_ARGS="-zks $IN3_ZKS -pk $IN3_PK -c $IN3_CHAIN"

deploy_gnosis_master_copy() 
{
  
  export G_MASTER_COPY=`in3 send -gas 8000000  -d $CODE -w  | jq -r .contractAddress` 
  echo "gnosis safe master copy succesfully deployed G_MASTER_COPY : $G_MASTER_COPY"
}

deploy_iamo_master_copy() 
{
  
  export IAMO_MASTER_COPY=`in3 send -gas 8000000  -d $CODE -w  | jq -r .contractAddress` 
  echo "iamo safe master copy succesfully deployed IAMO_MASTER_COPY : $IAMO_MASTER_COPY"
}

deploy_gnosis_factory()
{
  
  export G_FACTORY=`in3 send -gas 5000000  -d $CODE -w  | jq -r .contractAddress` 
  echo "gnosis safe factory succesfully deployed G_FACTORY : $G_FACTORY"
}

deploy_iamo_factory()
{
  
  export IAMO_FACTORY=`in3 send -gas 5000000  -d $CODE -w  | jq -r .contractAddress` 
  echo "iamo safe factory succesfully deployed IAMO_FACTORY : $IAMO_FACTORY"
}

deploy_gnosis_safe()
{
  # check factory ready
  test -n "$G_FACTORY" || deploy_gnosis_factory
  test -n "$G_MASTER_COPY" || deploy_gnosis_master_copy

  # prepare setup-tx
  threshold=$1
  shift
  owners="[\"$@\"]"
  owners=`echo $owners | sed -e 's/ /\\",\\"/g'`
  noadr=0x0000000000000000000000000000000000000000
  setup=`in3 abi_encode "setup(address[],uint256,address,bytes,address,address,uint256,address)" $owners $threshold $noadr 0x $noadr $noadr 0 $noadr`
  
  #deploy
  export G_SAFE=`in3 send -gas 5000000 -w -to $G_FACTORY  "createProxy(address,bytes)" $G_MASTER_COPY $setup |  jq -r ".logs[0].data" | sed -e 's/000000000000000000000000//g'`
  echo "gnosis safe succesfully deployed G_SAFE : $G_SAFE"
}

deploy_iamo_safe()
{
  # check factory ready
  test -n "$IAMO_FACTORY" || deploy_iamo_factory
  test -n "$IAMO_MASTER_COPY" || deploy_iamo_master_copy

  # prepare setup-tx
  threshold=$1
  shift
  #IAC
  owners="$@"
  roles=`node -p "JSON.stringify('$owners'.split(/ /).map(_=>_.substr(0,_.indexOf(':'))).map(_=>(_.indexOf('C')==-1?0:1)+(_.indexOf('I')==-1?0:2)+(_.indexOf('A')==-1?0:4)))"`
  owners=`node -p "JSON.stringify('$owners'.split(/ /).map(_=>_.substr(1+_.indexOf(':'))))"`
  noadr=0x0000000000000000000000000000000000000000
  setup=`in3 abi_encode "setup(address[],uint8[],uint32,address,bytes,address,address,uint256,address)" $owners $roles $threshold $noadr 0x $noadr $noadr 0 $noadr`

  #deploy
  export G_SAFE=`in3 send -gas 5000000 -w -to $IAMO_FACTORY  "createProxy(address,bytes)" $IAMO_MASTER_COPY $setup |  jq -r ".logs[0].data" | sed -e 's/000000000000000000000000//g'`
  echo "iamo safe succesfully deployed G_SAFE : $G_SAFE"
}


safe_get_owners() {
    in3 call -to $G_SAFE "getOwners():address[]"
}
safe_get_threshold() {
    in3 call -to $G_SAFE "getThreshold():uint"
}
safe_get_NAME() {
    in3 call -to $G_SAFE "NAME():string"
}
safe_fund_with_5eth() {
    in3 send -value 5.0eth -to $G_SAFE -w | jq
}
safe_balance() {
    in3 eth_getBalance $G_SAFE latest
}
safe_send() {
   in3 send -ms $G_SAFE -w $@ | jq
}
safe_get_roles_challengers() {
    in3 call -to $G_SAFE "getOwnersWithRole(uint8):address[]" 1
}
safe_get_roles_initiators() {
    in3 call -to $G_SAFE "getOwnersWithRole(uint8):address[]" 2
}
safe_get_roles_approvers() {
    in3 call -to $G_SAFE "getOwnersWithRole(uint8):address[]" 3
}
safe_get_nonce() {
    in3 call -to $G_SAFE "nonce():uint256"
}
safe_get_message_hash() {
    in3 call -to $G_SAFE "getMessageHash(bytes):bytes32" $1
}
safe_is_valid_signature() {
  name=`safe_get_NAME`
  if [ "$name" = "IAMO Safe" ]; then
    hash=`in3 web3_sha3 $1`
    res=`in3 call -to $G_SAFE "isValidSignature(bytes32,bytes):bytes4" $hash $2`
  else
    res=`in3 call -to $G_SAFE "isValidSignature(bytes,bytes):bytes4" $1 $2`
  fi
  test $res = 371636862 && echo "Yes" || echo "No"
}
safe_sign() {
  in3 in3_signData -ms $G_SAFE $1 $G_SAFE | jq -r .signature
}
safe_create_key() {
   export TEST_PK=`in3 createkey`
